rough this thing called life. Electric word life it means forever and that’s a mighty long time....but I’m here to tell you there’s something else....the afterworld”

Fitting start. So my sister @gojiramonamour and I had different taste in many MANY things.....but one thing we always agreed on was our love of Prince. Mom did as well and loved to recall her story of meeting him in an elevator at a hotel in Miami in the 80’s with her best friend. I recall the epic fight we had when she stole my Purple Rain tape. She was only 7 or 8 at the time .....so she really had good musical taste from the get go. I always thought it was strange she died on the same day as him just 2 years later.....

Monday will be, what should have been my sisters 41st birthday. I miss her every single day.....so today for my #centuryride on my #peloton I did the #epic #prince ride 
For her. For me. For us.

#GoWestGirl🚴🏻‍♀️

Thank you for the dozens of #pelotonriders who #highfived me before I even started! Thank you @allymisslove and @emmalovewell for such a fantastic ride! Thank you @onepeloton for helping me stay as grounded and sane as I can be during this time. Thank you to my late mother for always dancing around the kitchen to Prince with my sister and I when we were kids. 

I miss you sis and I think of you every single day and I ride to stay strong to be around for your babies. 

And of course when I get to be with them again.....I’ll introduce them to #princeandtherevolution 

I promise 💜💜
